package com.res.bean;public class ResItems implements java.io.Serializable {	private static final long serialVersionUID = 1L;		private Integer itemId;	private String itemNo;		private String itemName;	private String itemImg;	private String itemMoney;	private String itemDesc;	private String itemMemo;	private Integer itemType;	private Integer itemCreatetime;	private Integer itemAdduser;			public Integer getItemId() {		return itemId;	}	public void setItemId(Integer itemId) {		this.itemId = itemId;	}	public String getItemNo() {		return itemNo;	}	public void setItemNo(String itemNo) {		this.itemNo = itemNo;	}	public String getItemName() {		return itemName;	}	public void setItemName(String itemName) {		this.itemName = itemName;	}	public String getItemImg() {		return itemImg;	}	public void setItemImg(String itemImg) {		this.itemImg = itemImg;	}	public String getItemMoney() {		return itemMoney;	}	public void setItemMoney(String itemMoney) {		this.itemMoney = itemMoney;	}	public String getItemDesc() {		return itemDesc;	}	public void setItemDesc(String itemDesc) {		this.itemDesc = itemDesc;	}	public String getItemMemo() {		return itemMemo;	}	public void setItemMemo(String itemMemo) {		this.itemMemo = itemMemo;	}	public Integer getItemType() {		return itemType;	}	public void setItemType(Integer itemType) {		this.itemType = itemType;	}	public Integer getItemCreatetime() {		return itemCreatetime;	}	public void setItemCreatetime(Integer itemCreatetime) {		this.itemCreatetime = itemCreatetime;	}	public Integer getItemAdduser() {		return itemAdduser;	}	public void setItemAdduser(Integer itemAdduser) {		this.itemAdduser = itemAdduser;	}	}